INSERT INTO `reportcustomfilterdefinition` (`REPORTCUSTOMFILTERDEFINITION_ID`,`DISPLAY_HTML`,`DISPLAY_TEXT`,`SQL_TEXT`) VALUES 
 (100,'Codes - Account has a code type of <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" value=\"{0}\" /> with any code value','Codes - Account has a code type of [CODETYPE] with any code value','EXISTS (SELECT * FROM ENTITYCODES WHERE ENTITYCODES.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND CODETYPE = \'{0}\')'),
 (200,'Codes - Account has a code type of <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" value=\"{0}\" /> with any of the following code values : <br/> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1].criteria\" value=\"{1}\" /> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[2].criteria\" value=\"{2}\" /> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[3].criteria\" value=\"{3}\" /> <BR> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[4].criteria\" value=\"{4}\" /> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[5].criteria\"  value=\"{5}\" > <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[6].criteria\" value=\"{6}\" />','Codes - Account has a code type of [CODETYPE] <br>with any of the following code values : [CODEVALUE], [CODEVALUE], [CODEVALUE], [CODEVALUE], or [CODEVALUE]','EXISTS (SELECT * FROM ENTITYCODES WHERE ENTITYCODES.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND CODETYPE = \'{0}\' AND CODEVALUE IN (\'{1}\', \'{2}\', \'{3}\', \'{4}\', \'{5}\'))'),
 (300,'Gift Totals - Account gave at least $<span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" value=\"{0}\"style=\"width:75px\" fieldtype=\"MONEY\" /></span> in hard gifts in calendar year <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1].criteria\" value=\"{1}\" style=\"width:75px\" />','Gift Totals - Account gave at least $[GIFTAMOUNT] in hard gifts in calendar year [GIFTYEAR]','((SELECT SUM(AMT) FROM GIFTHEADER WHERE GIFTHEADER.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND YEAR(GDATE) = {1}) >= {0})'),
 (350,'Gift Totals - Account gave at least <span class=\"criteriaWrapper\">$<input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" value=\"{0}\" style=\"width:100px\" fieldtype=\"MONEY\" /></span> in hard gifts <br>between <span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1].criteria\" fieldtype=\"DATE\" value=\"{1}\" style=\"width:110px\"/></span> and <span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[2].criteria\" fieldtype=\"DATE\" value=\"{2}\" style=\"width:110px\"/></span>','Gift Totals - Account gave at least $[GIFTAMOUNT] in hard gifts between [GIFTDATE] and [GIFTDATE]','((SELECT SUM(AMT) FROM GIFTHEADER WHERE GIFTHEADER.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND GDATE BETWEEN {1} AND {2}) >= {0})'),
 (390,'Pledge Codes - Account has an active or fulfilled pledge code of <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" value=\"{0}\" />','Pledge Codes - Account has an active or fulfilled pledge code of [PLEDGECODE]','EXISTS (SELECT * FROM GIFTPLEDGE WHERE GIFTPLEDGE.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND PLDGCODE = \'{0}\' AND STATUS IN (\'A\',\'F\'))'),
 (400,'Segmentation - Account is in segmenation job number <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" value=\"{0}\" /> <br> and group number <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1].criteria\" value=\"{1}\" />','Segmentation - Account is in segmenation job number [JOBNUMBER] and group number [GROUPNUMBER]','EXISTS (SELECT * FROM S{0}G{1} SEGTABLE WHERE SEGTABLE.ENTITYID = [VIEWNAME].ENTITY_ENTITYID)'),
 (500,'Segmentation - Account is in merge job number <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" value=\"{0}\" />','Segmentation - Account is in merge job number [JOBNUMBER]','EXISTS (SELECT * FROM M{0} SEGTABLE WHERE SEGTABLE.ENTITYID = [VIEWNAME].ENTITY_ENTITYID)'),
 (600,'Zip Radius - Account is within <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" style=\"width:75px\" value=\"{0}\" /> miles of zip code <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1].criteria\" style=\"width:100px\" value=\"{1}\" />','Zip Radius - Account is within [ZIPRADIUS] miles of zip code [ZIPCODE]','(CONVERT(VARCHAR(5), [VIEWNAME].ENTITY_POSTALCODE) IN (SELECT TOZIP.ZIPLOW AS POSTALCODE FROM ZIPCODES TOZIP CROSS JOIN (SELECT * FROM ZIPCODES FROMZIP WHERE FROMZIP.ZIPLOW = \'{1}\') FROMZIP WHERE SQRT(((69.1 * (TOZIP.LATITUDE - FROMZIP.LATITUDE)) * (69.1 * (TOZIP.LATITUDE - FROMZIP.LATITUDE))) + ((53 * (TOZIP.LONGITUDE - FROMZIP.LONGITUDE)) * (53 * (TOZIP.LONGITUDE - FROMZIP.LONGITUDE)))) <= {0}))');
